DROP TABLE IF EXISTS regions;
DROP TABLE IF EXISTS provinces;
DROP TABLE IF EXISTS municipalities;

CREATE TABLE regions(id SERIAL not null primary key, division VARCHAR(40), code int, name VARCHAR(40), created_at timestamp, updated_at timestamp);
CREATE TABLE provinces(id SERIAL not null primary key, region_id int, code int, name VARCHAR(40), abbreviation VARCHAR(2), created_at timestamp, updated_at timestamp);
CREATE TABLE municipalities(id SERIAL not null primary key, province_id int, code int, name VARCHAR(100), created_at timestamp, updated_at timestamp);
